import React from 'react';
import {
    IonSplitPane,
} from '@ionic/react';
import Menu from './menu';
import { Router } from './router';

export const Header: React.FC = () => {
    return (
        <IonSplitPane contentId="main">
            <Menu />
            <Router />
        </IonSplitPane>
    );
}
